import styled from 'styled-components';

export const Container = styled.div`
  display: flex;
  background: #ffffff;
  height: 72px;
  align-items: center;
  justify-content: space-between;
  padding: 0 70px;
  a {
    font-size: 14px;
    line-height: 17px;
    color: #000000;
    text-decoration: none;
    margin: 0 5px;
  }
  @media (max-width: 1130px) {
    padding: 0 30px;
  }
`;

export const Logo = styled.div`
  img {
    width: 130px;
  }
`;

export const Nav = styled.div`
  display: flex;
  justify-content: space-between;
  align-items: center;
  max-width: 412px;
  width: 100%;
  margin: 0 15px;
`;

export const Actions = styled.div`
  display: flex;
  justify-content: space-between;
  align-items: center;
  max-width: 334px;
  width: 100%;
  margin: 0 15px;
  @media (max-width: 994px) {
    padding: 0 30px;
  }
`;
